@EU_Commission @NATO 
Ukraine needs help now.
See that 40-mile long Russian convoy that is pushing towards Kyiv? I call that a sitting duck. Can you do something to stop it?

@EU_Commission Putin against the world!!!
Putin, listen.
When the era of a man is coming to an end, dead always blind his eyes.

@EU_Commission Good!
We need to cut off Russian gas and oil as well.
Europeans believe in freedom and peace for Ukraine and will do whatever is necessary to protect it!

@EU_Commission .@EU_Commission 
The world thanks you!
(well everyone except the countries assaulting Ukraine)
